import React from "react";
import Projects from "./Projects";
import { Container } from "semantic-ui-react";
import "./style.css";

const Portfolio = () => (
  <div>
    <Container id="portfolio">
      <div className="wrapper">
        <PageTitle title="My" />
      </div>
    </Container>
  </div>
);

export default Portfolio;
